import React,{useState} from 'react'
import {FaBars,FaTimes,FaGithub,FaLinkedin} from 'react-icons/fa'
import {HiOutLineMail} from 'react-icons/hi'


const Navbar = () => {
  const [nav,setnav]=useState(false);
  const handleClick=()=>{
    setnav(!nav);
  }
  return (
    <div className='fixed w-full h-[80px] px-4 flex items-center justify-between bg-[#0a192f] text-gray-300'>
      {/* Logo goes here */}
      <div>
        <h1 className='text-md'>Moavia | Portfolio</h1>
      </div>

      {/* menu */}
      <ul className='md:flex hidden'>
        <li>Home</li>
        <li>About</li>
        <li>Skills</li>
        <li>Projects</li>
        <li>Contact</li>
      </ul>

      {/* hamburger div */}
      <div onClick={handleClick} className='md:hidden z-10'>
        {!nav ? <FaBars></FaBars> : <FaTimes></FaTimes>}
      </div>
      {/* Mobile menu */}
      <ul className={!nav ? 'hidden' : 'flex flex-col absolute w-full h-screen  top-0 left-0 justify-center items-center bg-[#0a192f]'}>
        <li className='py-6 text-4xl'>Home</li>
        <li className='py-6 text-4xl'>About</li>
        <li className='py-6 text-4xl'>Skills</li>
        <li className='py-6 text-4xl'>Projects</li>
        <li className='py-6 text-4xl'>Contact</li>
      </ul>

      {/* Soical Icons */}
      <div className=' fixed top-[35%] left-0 flex flex-col '>
        <ul>
          <li>
            <a href='/'>LinkedIn</a>
          </li>
        </ul>
      </div>
    </div>
  )
}

export default Navbar
